import React from "react"

class Element extends React.Component {
    render () {
    return (
        <div>
            <div className="container">
            <h1>Weathear</h1>
            <form>
                <div className="form-group" onSubmit={this.methodWeather}>
                    <label for="exampleInputEmail1">Get Weather forecast anywhere</label>
                    <input type="text" className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" placeholder="Enter your city"/>
                    <small id="emailHelp" className="form-text text-muted">We'll never share your email with anyone else.</small>
                </div>
                <button type="submit" className="btn btn-primary">Search</button>
            </form>
        </div>
        </div>
    );
    }
}

export default Element;
